import React from 'react';
import './Add.css'
import Slideshow from '../Components/Img-slideshow';

function Add() {
    return (
        <div className='container'>
            <div className="content-wrapper">
                <Slideshow></Slideshow>
            </div>
        </div>
    );
}

export default Add;
